import React from 'react';
import { Link } from 'react-router-dom';

function Footer() {
    return (
        <footer style={{
            background: '#333', // Dark background for contrast
            color: 'white',
            padding: '40px 20px',
            textAlign: 'center',
            fontFamily: '"Segoe UI", Tahoma, Geneva, Verdana, sans-serif'
        }}>
            <div style={{ marginBottom: '20px' }}>
                <h3 style={{
                    fontSize: '20px',
                    margin: '10px 0'
                }}>Contact Information</h3>
                <p style={{
                    margin: '10px 0',
                    fontSize: '16px'
                }}>crystalsaddlerphotography@yahoo.com</p>
            </div>
            <nav style={{ marginBottom: '20px' }}>
                <ul style={{
                    listStyleType: 'none',
                    padding: 0,
                    margin: 0,
                    display: 'flex',
                    justifyContent: 'center',
                    gap: '20px'
                }}>
                    <li><Link to="/" style={{
                        color: 'white',
                        textDecoration: 'none',
                        fontSize: '16px'
                    }}>Home</Link></li>
                    <li><Link to="/about" style={{
                        color: 'white',
                        textDecoration: 'none',
                        fontSize: '16px'
                    }}>About</Link></li>
                    <li><Link to="/contact" style={{
                        color: 'white',
                        textDecoration: 'none',
                        fontSize: '16px'
                    }}>Contact Us</Link></li>
                </ul>
            </nav>
            <div>
                <p style={{
                    fontSize: '14px',
                    margin: '10px 0'
                }}>Â© {new Date().getFullYear()} Crystal Saddler Photography. All rights reserved.</p>
            </div>
        </footer>
    );
}

export default Footer;
